    return (
        <View>
            <ImageDetails title={'Forest'} imageSource={require('../../assets/forest.jpg')} />
            <ImageDetails title={'Beach'} imageSource={require('../../assets/beach.jpg')} />
            <ImageDetails title={'Mountain'} imageSource={require('../../assets/mountain.jpg')} />
        </View>
    )
}

